<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>test 2 | Extra Miles Energy</title>
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.4.0/css/all.min.css">
    <style>
        :root {
            --primary: #0b1220;
            --secondary: #142044;
            --gold: #FFD700;
            --gold-light: #FFF9C4;
            --accent: #35d0ff;
            --text: #ffffff;
            --text-muted: #a0b3d9;
            --card-bg: rgba(20, 32, 68, 0.95);
            --radius: 16px;
            --radius-sm: 10px;
        }
        
        * { margin: 0; padding: 0; box-sizing: border-box; }
        
        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, sans-serif;
            background: var(--primary);
            color: var(--text);
            line-height: 1.6;
        }
        
        .container {
            max-width: 1200px;
            margin: 0 auto;
            padding: 20px;
        }
        
        .header {
            background: var(--card-bg);
            border-bottom: 2px solid var(--gold);
            padding: 15px 0;
            margin-bottom: 30px;
        }
        
        .product-detail {
            background: var(--card-bg);
            border: 2px solid rgba(255, 215, 0, 0.2);
            border-radius: var(--radius);
            padding: 30px;
        }
        
        .product-gallery {
            margin-bottom: 30px;
        }
        
        .main-image {
            width: 100%;
            height: 400px;
            display: flex;
            align-items: center;
            justify-content: center;
            background: rgba(0, 0, 0, 0.2);
            border-radius: var(--radius);
            padding: 20px;
            margin-bottom: 20px;
            border: 1px solid rgba(255, 215, 0, 0.2);
        }
        
        .main-image img {
            max-width: 100%;
            max-height: 100%;
            object-fit: contain;
        }
        
        .thumbnail-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(80px, 1fr));
            gap: 10px;
        }
        
        .thumbnail {
            width: 100%;
            height: 80px;
            object-fit: contain;
            border: 2px solid rgba(255, 215, 0, 0.2);
            border-radius: var(--radius-sm);
            cursor: pointer;
            background: rgba(0, 0, 0, 0.2);
            padding: 5px;
            transition: all 0.3s ease;
        }
        
        .thumbnail:hover {
            border-color: var(--gold);
            transform: scale(1.05);
        }
        
        .product-title {
            font-size: 2rem;
            color: var(--gold);
            margin-bottom: 10px;
        }
        
        .product-specs {
            color: var(--accent);
            font-size: 1.2rem;
            margin-bottom: 20px;
        }
        
        .price {
            font-size: 2rem;
            color: var(--gold);
            font-weight: 700;
            margin-bottom: 30px;
        }
        
        .specs-table {
            width: 100%;
            border-collapse: collapse;
            margin: 30px 0;
        }
        
        .specs-table td {
            padding: 12px;
            border: 1px solid rgba(255, 215, 0, 0.2);
        }
        
        .specs-table td:first-child {
            background: rgba(255, 215, 0, 0.05);
            color: var(--gold-light);
            font-weight: 600;
            width: 200px;
        }
        
        .features-list {
            list-style: none;
            margin: 30px 0;
        }
        
        .features-list li {
            padding: 10px 0;
            border-bottom: 1px solid rgba(255, 255, 255, 0.1);
            display: flex;
            align-items: center;
            gap: 10px;
        }
        
        .action-buttons {
            display: flex;
            gap: 15px;
            margin: 40px 0;
            flex-wrap: wrap;
        }
        
        .btn {
            padding: 15px 30px;
            border: none;
            border-radius: var(--radius-sm);
            font-weight: 700;
            cursor: pointer;
            transition: all 0.3s ease;
            display: inline-flex;
            align-items: center;
            justify-content: center;
            gap: 10px;
            text-decoration: none;
            flex: 1;
            min-width: 200px;
        }
        
        .btn-whatsapp {
            background: #25D366;
            color: white;
        }
        
        .btn-whatsapp:hover {
            background: #128C7E;
            transform: translateY(-2px);
        }
        
        .btn-call {
            background: var(--accent);
            color: var(--primary);
        }
        
        .btn-call:hover {
            background: var(--gold);
            transform: translateY(-2px);
        }
        
        .btn-datasheet {
            background: var(--danger);
            color: white;
        }
        
        .btn-datasheet:hover {
            background: #ff2b5e;
            transform: translateY(-2px);
        }
        
        .description {
            margin: 30px 0;
            padding: 20px;
            background: rgba(255, 255, 255, 0.05);
            border-radius: var(--radius-sm);
            line-height: 1.8;
        }
        
        @media (max-width: 768px) {
            .main-image { height: 300px; }
            .product-title { font-size: 1.5rem; }
            .action-buttons { flex-direction: column; }
        }
    </style>
</head>
